import React, { useState } from 'react';
import { friendsAPI } from '../../services/api';

function SearchUsers() {
  const [searchQuery, setSearchQuery] = useState('');
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [sendingRequest, setSendingRequest] = useState({});

  const handleSearch = async (e) => {
    e.preventDefault();
    if (searchQuery.trim().length < 2) {
      setError('Please enter at least 2 characters');
      return;
    }

    setLoading(true);
    setError('');

    try {
      const response = await friendsAPI.searchUsers(searchQuery);
      setUsers(response.data.users);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to search users');
    } finally {
      setLoading(false);
    }
  };

  const handleSendRequest = async (userId) => {
    setSendingRequest({ ...sendingRequest, [userId]: true });

    try {
      const response = await friendsAPI.sendRequest(userId);
      
      // Update user status in list
      setUsers(users.map(user => 
        user.id === userId 
          ? { ...user, requestStatus: 'sent' }
          : user
      ));

      // Show success message
      alert(response.data.message);
    } catch (err) {
      alert(err.response?.data?.message || 'Failed to send friend request');
    } finally {
      setSendingRequest({ ...sendingRequest, [userId]: false });
    }
  };

  return (
    <div className="fade-in">
      <div className="content-header">
        <h1 className="content-title">üîç Find Friends</h1>
        <p className="content-subtitle">Search and connect with new people</p>
      </div>

      <div className="search-section">
        <form onSubmit={handleSearch} className="search-bar">
          <span className="search-icon">üîç</span>
          <input
            type="text"
            className="search-input"
            placeholder="Search by username or email..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
        </form>
      </div>

      {error && (
        <div className="alert alert-error shake">
          ‚ö†Ô∏è {error}
        </div>
      )}

      {loading ? (
        <div style={{ textAlign: 'center', padding: '3rem' }}>
          <div className="spinner"></div>
          <p style={{ marginTop: '1rem', color: 'var(--gray-600)' }}>Searching...</p>
        </div>
      ) : users.length > 0 ? (
        <div className="users-grid">
          {users.map((user, index) => (
            <div key={user.id} className={`user-card glass-card stagger-item`} style={{ animationDelay: `${index * 0.1}s` }}>
              <div className="user-card-header">
                <div className="user-card-avatar">
                  {user.username.charAt(0).toUpperCase()}
                </div>
                <div className="user-card-info">
                  <div className="user-card-name">{user.username}</div>
                  <div className="user-card-email">{user.email}</div>
                </div>
              </div>
              
              <div className="user-card-actions">
                {user.requestStatus === 'sent' ? (
                  <button className="btn btn-secondary" disabled>
                    ‚úì Request Sent
                  </button>
                ) : user.requestStatus === 'received' ? (
                  <button className="btn btn-primary" disabled>
                    ‚úì Request Received
                  </button>
                ) : (
                  <button 
                    className="btn btn-primary"
                    onClick={() => handleSendRequest(user.id)}
                    disabled={sendingRequest[user.id]}
                  >
                    {sendingRequest[user.id] ? (
                      <>
                        <div className="spinner" style={{ width: '16px', height: '16px', borderWidth: '2px' }}></div>
                        Sending...
                      </>
                    ) : (
                      <>
                        ‚ûï Add Friend
                      </>
                    )}
                  </button>
                )}
              </div>
            </div>
          ))}
        </div>
      ) : searchQuery && !loading ? (
        <div className="empty-state">
          <div className="empty-state-icon">üîç</div>
          <h3 className="empty-state-title">No users found</h3>
          <p className="empty-state-text">Try searching with a different username or email</p>
        </div>
      ) : (
        <div className="empty-state">
          <div className="empty-state-icon">üë•</div>
          <h3 className="empty-state-title">Start Searching</h3>
          <p className="empty-state-text">Enter a username or email to find friends</p>
        </div>
      )}
    </div>
  );
}

export default SearchUsers;
